### Ethereum Blockchain Messenger Smart Contract

Below is a Solidity smart contract that fulfills the requirements of the blockchain messenger. This contract uses the `pragma` directive to specify the version of the Solidity compiler it is compatible with. It also includes a `contract` declaration with a name, `BlockchainMessenger`, and a description.

```solidity
pragma solidity ^0.8.0;

contract BlockchainMessenger {
    // Mapping of message IDs to their respective message objects
    mapping (uint256 => Message) public messages;
    // Mapping of message IDs to their respective update counts
    mapping (uint256 => uint256) public updateCounts;
    // Mapping of message IDs to their respective authors
    mapping (uint256 => address) public authors;
    // Mapping of authors to their respective message IDs
    mapping (address => uint256) public authorMessages;
    // Counter for generating unique message IDs
    uint256 public messageIdCounter;

    // Struct to represent a message
    struct Message {
        string content;
        bool isPublic;
    }

    // Event emitted when a new message is created
    event NewMessage(uint256 messageId, string content, bool isPublic, address author);

    // Event emitted when a message is updated
    event MessageUpdated(uint256 messageId, string content, bool isPublic, address author);

    // Function to create a new message
    function createMessage(string memory _content, bool _isPublic) public {
        // Generate a new message ID
        uint256 messageId = messageIdCounter++;
        // Store the message in the mapping
        messages[messageId] = Message(_content, _isPublic);
        // Store the author of the message
        authors[messageId] = msg.sender;
        // Store the message ID in the author's mapping
        authorMessages[msg.sender] = messageId;
        // Emit the NewMessage event
        emit NewMessage(messageId, _content, _isPublic, msg.sender);
    }

    // Function to update a message
    function updateMessage(uint256 _messageId, string memory _content, bool _isPublic) public {
        // Check if the message exists
        require(messages[_messageId].content != "", "Message does not exist");
        // Check if the sender is the author of the message
        require(authors[_messageId] == msg.sender, "Only the author can update the message");
        // Update the message in the mapping
        messages[_messageId].content = _content;
        messages[_messageId].isPublic = _isPublic;
        // Increment the update count
        updateCounts[_messageId]++;
        // Emit the MessageUpdated event
        emit MessageUpdated(_messageId, _content, _isPublic, msg.sender);
    }

    // Function to get a message by ID
    function getMessage(uint256 _messageId) public view returns (string memory, bool) {
        // Check if the message exists
        require(messages[_messageId].content != "", "Message does not exist");
        // Return the message content and public status
        return (messages[_messageId].content, messages[_messageId].isPublic);
    }

    // Function to get the update count of a message
    function getUpdateCount(uint256 _messageId) public view returns (uint256) {
        // Return the update count
        return updateCounts[_messageId];
    }
}
